- input: "TEXT\x1CC00007658\x1CTEXT-00001\x1C\x1CF3XA\x1CThe purpose of this report
    is to clarify items from the previous amendment.    1.  The Committee has used
    its best efforts to obtain the proper employer and occupation for each donor.
    \ Additional information was added to the previous amendment.    2.  Receipts
    from federal campaign committees were transfers and have now been reported as
    such.    3.  Additional addresses were added to Schedules B and H4 on the previous
    amendment.    4.  The Committee's Levin Funds were stored in a non federal account
    that functioned both as a Levin and Non Federal account.  The funds were tracked
    using the Committee's campaign finance database that has utilities built in for
    the tracking of Levin Funds.    5.  The transfer on Schedule H5 has now been properly
    reported on Schedule L-B.    6.  The disbursements on Schedule B, supporting Line
